    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+b*atan(c*x^1))^p=#


    @test_int [(d + e*x)^4*(a + b*atan(c*x)), x, 6, -((b*d*e*(2*c^2*d^2 - e^2)*x)/c^3) - (b*e^2*(10*c^2*d^2 - e^2)*x^2)/(10*c^3) - (b*d*e^3*x^3)/(3*c) - (b*e^4*x^4)/(20*c) - (b*d*(c^4*d^4 - 10*c^2*d^2*e^2 + 5*e^4)*atan(c*x))/(5*c^4*e) + ((d + e*x)^5*(a + b*atan(c*x)))/(5*e) - (b*(5*c^4*d^4 - 10*c^2*d^2*e^2 + e^4)*log(1 + c^2*x^2))/(10*c^5)]
    @test_int [(d + e*x)^3*(a + b*atan(c*x)), x, 6, -(b*e*(6*c^2*d^2 - e^2)*x)/(4*c^3) - (b*d*e^2*x^2)/(2*c) - (b*e^3*x^3)/(12*c) - (b*(c^4*d^4 - 6*c^2*d^2*e^2 + e^4)*atan(c*x))/(4*c^4*e) + ((d + e*x)^4*(a + b*atan(c*x)))/(4*e) - (b*d*(c*d - e)*(c*d + e)*log(1 + c^2*x^2))/(2*c^3)]
