    @test_int [(a + b*atan(c*x))/(d + e*x)^1, x, 4, -(((a + b*atan(c*x))*log(2/(1 - im*c*x)))/e) + ((a + b*atan(c*x))*log((2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/e + (im*b*PolyLog(2, 1 - 2/(1 - im*c*x)))/(2*e) - (im*b*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(2*e)]
