    @test_int [(a + b*atan(c*x))/(d + e*x)^3, x, 7, -(b*c)/(2*(c^2*d^2 + e^2)*(d + e*x)) + (b*c^2*(c*d - e)*(c*d + e)*atan(c*x))/(2*e*(c^2*d^2 + e^2)^2) - (a + b*atan(c*x))/(2*e*(d + e*x)^2) + (b*c^3*d*log(d + e*x))/(c^2*d^2 + e^2)^2 - (b*c^3*d*log(1 + c^2*x^2))/(2*(c^2*d^2 + e^2)^2)]
    @test_int [(a + b*atan(c*x))/(d + e*x)^4, x, 7, -(b*c)/(6*(c^2*d^2 + e^2)*(d + e*x)^2) - (2*b*c^3*d)/(3*(c^2*d^2 + e^2)^2*(d + e*x)) + (b*c^4*d*(c^2*d^2 - 3*e^2)*atan(c*x))/(3*e*(c^2*d^2 + e^2)^3) - (a + b*atan(c*x))/(3*e*(d + e*x)^3) + (b*c^3*(3*c^2*d^2 - e^2)*log(d + e*x))/(3*(c^2*d^2 + e^2)^3) - (b*c^3*(3*c^2*d^2 - e^2)*log(1 + c^2*x^2))/(6*(c^2*d^2 + e^2)^3)]


