    @test_int [(d + e*x)^2*(a + b*atan(c*x))^2, x, 15, (-2*a*b*d*e*x)/c + (b^2*e^2*x)/(3*c^2) - (b^2*e^2*atan(c*x))/(3*c^3) - (2*b^2*d*e*x*atan(c*x))/c - (b*e^2*x^2*(a + b*atan(c*x)))/(3*c) + ((im/3)*(3*c^2*d^2 - e^2)*(a + b*atan(c*x))^2)/c^3 - (d*(d^2 - (3*e^2)/c^2)*(a + b*atan(c*x))^2)/(3*e) + ((d + e*x)^3*(a + b*atan(c*x))^2)/(3*e) + (2*b*(3*c^2*d^2 - e^2)*(a + b*atan(c*x))*log(2/(1 + im*c*x)))/(3*c^3) + (b^2*d*e*log(1 + c^2*x^2))/c^2 + ((im/3)*b^2*(3*c^2*d^2 - e^2)*PolyLog(2, 1 - 2/(1 + im*c*x)))/c^3]
