    @test_int [(a + b*atan(c*x))^2/(d + e*x)^2, x, 13, (im*c*(a + b*atan(c*x))^2)/(c^2*d^2 + e^2) + (c^2*d*(a + b*atan(c*x))^2)/(e*(c^2*d^2 + e^2)) - (a + b*atan(c*x))^2/(e*(d + e*x)) - (2*b*c*(a + b*atan(c*x))*log(2/(1 - im*c*x)))/(c^2*d^2 + e^2) + (2*b*c*(a + b*atan(c*x))*log(2/(1 + im*c*x)))/(c^2*d^2 + e^2) + (2*b*c*(a + b*atan(c*x))*log((2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(c^2*d^2 + e^2) + (im*b^2*c*PolyLog(2, 1 - 2/(1 - im*c*x)))/(c^2*d^2 + e^2) + (im*b^2*c*PolyLog(2, 1 - 2/(1 + im*c*x)))/(c^2*d^2 + e^2) - (im*b^2*c*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(c^2*d^2 + e^2)]
    @test_int [(a + b*atan(c*x))^2/(d + e*x)^3, x, 19, (b^2*c^3*d*atan(c*x))/(c^2*d^2 + e^2)^2 - (b*c*(a + b*atan(c*x)))/((c^2*d^2 + e^2)*(d + e*x)) + (im*c^3*d*(a + b*atan(c*x))^2)/(c^2*d^2 + e^2)^2 + (c^2*(c*d - e)*(c*d + e)*(a + b*atan(c*x))^2)/(2*e*(c^2*d^2 + e^2)^2) - (a + b*atan(c*x))^2/(2*e*(d + e*x)^2) - (2*b*c^3*d*(a + b*atan(c*x))*log(2/(1 - im*c*x)))/(c^2*d^2 + e^2)^2 + (2*b*c^3*d*(a + b*atan(c*x))*log(2/(1 + im*c*x)))/(c^2*d^2 + e^2)^2 + (b^2*c^2*e*log(d + e*x))/(c^2*d^2 + e^2)^2 + (2*b*c^3*d*(a + b*atan(c*x))*log((2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(c^2*d^2 + e^2)^2 - (b^2*c^2*e*log(1 + c^2*x^2))/(2*(c^2*d^2 + e^2)^2) + (im*b^2*c^3*d*PolyLog(2, 1 - 2/(1 - im*c*x)))/(c^2*d^2 + e^2)^2 + (im*b^2*c^3*d*PolyLog(2, 1 - 2/(1 + im*c*x)))/(c^2*d^2 + e^2)^2 - (im*b^2*c^3*d*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(c^2*d^2 + e^2)^2]


