    @test_int [(d + e*x)^2*(a + b*atan(c*x))^3, x, 20, (a*b^2*e^2*x)/c^2 + (b^3*e^2*x*atan(c*x))/c^2 - ((3*im)*b*d*e*(a + b*atan(c*x))^2)/c^2 - (b*e^2*(a + b*atan(c*x))^2)/(2*c^3) - (3*b*d*e*x*(a + b*atan(c*x))^2)/c - (b*e^2*x^2*(a + b*atan(c*x))^2)/(2*c) + ((im/3)*(3*c^2*d^2 - e^2)*(a + b*atan(c*x))^3)/c^3 - (d*(d^2 - (3*e^2)/c^2)*(a + b*atan(c*x))^3)/(3*e) + ((d + e*x)^3*(a + b*atan(c*x))^3)/(3*e) - (6*b^2*d*e*(a + b*atan(c*x))*log(2/(1 + im*c*x)))/c^2 + (b*(3*c^2*d^2 - e^2)*(a + b*atan(c*x))^2*log(2/(1 + im*c*x)))/c^3 - (b^3*e^2*log(1 + c^2*x^2))/(2*c^3) - ((3*im)*b^3*d*e*PolyLog(2, 1 - 2/(1 + im*c*x)))/c^2 + (im*b^2*(3*c^2*d^2 - e^2)*(a + b*atan(c*x))*PolyLog(2, 1 - 2/(1 + im*c*x)))/c^3 + (b^3*(3*c^2*d^2 - e^2)*PolyLog(3, 1 - 2/(1 + im*c*x)))/(2*c^3)]
    @test_int [(d + e*x)^1*(a + b*atan(c*x))^3, x, 14, (((-3*im)/2)*b*e*(a + b*atan(c*x))^2)/c^2 - (3*b*e*x*(a + b*atan(c*x))^2)/(2*c) + (im*d*(a + b*atan(c*x))^3)/c - ((d^2 - e^2/c^2)*(a + b*atan(c*x))^3)/(2*e) + ((d + e*x)^2*(a + b*atan(c*x))^3)/(2*e) - (3*b^2*e*(a + b*atan(c*x))*log(2/(1 + im*c*x)))/c^2 + (3*b*d*(a + b*atan(c*x))^2*log(2/(1 + im*c*x)))/c - (((3*im)/2)*b^3*e*PolyLog(2, 1 - 2/(1 + im*c*x)))/c^2 + ((3*im)*b^2*d*(a + b*atan(c*x))*PolyLog(2, 1 - 2/(1 + im*c*x)))/c + (3*b^3*d*PolyLog(3, 1 - 2/(1 + im*c*x)))/(2*c)]
