    @test_int [(a + b*atan(c*x))^3/(d + e*x)^2, x, 10, (im*c*(a + b*atan(c*x))^3)/(c^2*d^2 + e^2) + (c^2*d*(a + b*atan(c*x))^3)/(e*(c^2*d^2 + e^2)) - (a + b*atan(c*x))^3/(e*(d + e*x)) - (3*b*c*(a + b*atan(c*x))^2*log(2/(1 - im*c*x)))/(c^2*d^2 + e^2) + (3*b*c*(a + b*atan(c*x))^2*log(2/(1 + im*c*x)))/(c^2*d^2 + e^2) + (3*b*c*(a + b*atan(c*x))^2*log((2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(c^2*d^2 + e^2) + (3*im*b^2*c*(a + b*atan(c*x))*PolyLog(2, 1 - 2/(1 - im*c*x)))/(c^2*d^2 + e^2) + (3*im*b^2*c*(a + b*atan(c*x))*PolyLog(2, 1 - 2/(1 + im*c*x)))/(c^2*d^2 + e^2) - (3*im*b^2*c*(a + b*atan(c*x))*PolyLog(2, 1 - (2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(c^2*d^2 + e^2) - (3*b^3*c*PolyLog(3, 1 - 2/(1 - im*c*x)))/(2*(c^2*d^2 + e^2)) + (3*b^3*c*PolyLog(3, 1 - 2/(1 + im*c*x)))/(2*(c^2*d^2 + e^2)) + (3*b^3*c*PolyLog(3, 1 - (2*c*(d + e*x))/((c*d + im*e)*(1 - im*c*x))))/(2*(c^2*d^2 + e^2))]
